import React from 'react';
import { Container } from 'react-bootstrap';

const Success = () => {
    return (
        <Container>
            <h1 style={{ marginTop:"130px", textAlign:'center'}}>БЛАГОДАРИМ ВАС ЗА ЗАКАЗ! ВСКОРЕ МЫ С ВАМИ СВЯЖЕМСЯ!</h1>
        </Container>
    );
};

export default Success;
